import { createIcon } from "../icon/createIcon";

export const MoveHorizontalIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="MoveHorizontalIcon">
    <path d="M5 5.25v1.5H2.999L3 9 0 6l3-3-.001 2.25H5zM12 6 9 9V6.75H7v-1.5h2V3l3 3z" />
  </svg>,
  "MoveHorizontal",
  "move horizontal"
);
